To create a web application using React, Node.js, and Express.js, you can follow these steps:

1. Set up the project structure:

Create a new directory for your project and navigate to it in your terminal.

```
mkdir my-app
cd my-app
```

2. Initialize a new Node.js project:

Run `npm init` to create a new `package.json` file. You can accept the default values by pressing enter for each prompt.

```
npm init -y
```

3. Install dependencies:

Install the necessary dependencies for your project, including React, React DOM, Express.js, and any other packages you need.

```
npm install express react react-dom
```

4. Create a server:

Create a new file called `server.js` in the root of your project directory. This file will contain the code for your Express.js server.

```
const express = require('express');
const app = express();
const port = 3000;

app.use(express.static('public'));

app.get('/', (req, res) => {
  res.send('Hello World!');
});

app.listen(port, () => {
  console.log(`Server is running on port ${port}`);
});
```

5. Create a React app:

Create a new directory called `public` in the root of your project directory. This directory will contain your React app.

```
mkdir public
cd public
```

Inside the `public` directory, run `npx create-react-app` to create a new React app.

```
npx create-react-app .
```

6. Modify the React app:

Open the `public/src/App.js` file and modify the code to display a list of dummy data.

```jsx
import React from 'react';

const data = [
  { id: 1, name: 'Item 1' },
  { id: 2, name: 'Item 2' },
  { id: 3, name: 'Item 3' },
];

function App() {
  return (
    <div>
      <h1>My Dummy Data</h1>
      <ul>
        {data.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
```

7. Build the React app:

In the `public` directory, run `npm run build` to build the React app.

```
cd public
npm run build
```

8. Modify the server:

In the `server.js` file, modify the code to serve the built React app.

```js
const express = require('express');
const app = express();
const port = 3000;

app.use(express.static('public/build'));

app.get('/', (req, res) => {
  res.sendFile('index.html', { root: 'public/build' });
});

app.listen(port, () => {
  console.log(`Server is running on port ${port}`);
});
```

9. Start the server:

In the root of your project directory, run `node server.js` to start the server.

```
node server.js
```

10. Deploy the code:

To deploy your code, you can use a hosting service like Heroku, AWS, or Google Cloud. You will need to create an account, install the necessary tools, and follow the deployment instructions for your chosen service.

For example, to deploy to Heroku, you can follow these steps:

* Install the Heroku CLI.
* Log in to your Heroku account using the CLI.
